      border:"1px solid",
      height:'35px',
      width:'35px',
      display:'none'
    }



  return (

    <>
     <nav className='main-navbar bg-secondary'>
        <div>
        <h1>Portfolio</h1>
        </div>

        <ul className='navbar navbar-collapse' id='navmenu'>
            <li> <Link to='/'>Home</Link> </li>
            <li> <Link to='/Login'>Login</Link>  </li>
            <li> <Link to='/Signup' >SignUp</Link> </li>
            <li> <Link to='/Aboutus' >About </Link> </li>
           <FontAwesomeIcon icon="bars" size='xl' style={iconstyle} className='menu-icon'/>
        </ul>
      </nav>



      <Routes>
    <Route path='/'  element={ <Landing/> } />
    <Route path='/Login'  element={ <Login/> } />
    <Route path='/Signup'  element={ <Signup/> } />
    <Route path='/Aboutus'  element={ <About/> } />
     </Routes>


    </>
  );
}

export default App;
